import React from 'react';
import { Table } from 'antd';
import { HeartOutlined } from '@ant-design/icons';

const Wrapper1 = () => {

    const columns = [
        {
            title: '职位名称',
            dataIndex: 'name',
            key: 'name',
            render: (text) => <a>{text}</a>,
        },
        {
            title: '职位类别',
            dataIndex: 'category',
            key: 'category',
        },
        {
            title: '工作地点',
            dataIndex: 'address',
            key: 'address',
        },
        {
            title: '工作年限',
            dataIndex: 'date',
            key: 'date',
        },
        {
            title: '更新时间',
            key: 'renew',
            dataIndex: 'renew',
        },
        {
            title: '收藏',
            key: 'action',
            render: (_, record) => (
                <HeartOutlined />
            ),
        },
    ];
    const data = [
        {
            key: '1',
            name: '搜索产品增长运营-【主站】',
            category: '运营类',
            address: '北京',
            date: '3-5年',
            renew: '2023.10.17',
            tags: ['nice', 'developer'],
        },
        {
            key: '2',
            name: '行业运营经理（中小方向）-【商业化】',
            category: '运营类',
            date: '3-5年',
            address: '北京',
            renew: '2023.10.17',
            tags: ['loser'],
        },
        {
            key: '3',
            name: '产品运营专家（中小方向）-【商业化】',
            category: '运营类',
            date: '3-5年',
            address: '北京',
            renew: '2023.10.17',
            tags: ['cool', 'teacher'],
        },
    ];
    return (
        <Table columns={columns} dataSource={data} />
    )
}

export default Wrapper1
